import React from 'react';
import './App.css';

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      username: '',
      password: '',
    }
  }

  render() {
    return(
      <div className="App">
        <input aria-label="Username" type="text" value={this.state.username} onChange={window.alert("Hi", this.state.username)}></input>
        <input aria-label="Password" type="password" value={this.state.password} onChange={console.log("Working")}></input>
      </div>
    );
  }
}

export default App;
